INSERT INTO `ayuda_opcion` (`IDmensaje`, `IDopcion`, `Descripcion`, `fecCreacion`, `hraCreacion`) VALUES
('4zpanfrmcd751krl57sdk1ox04q6anwbdzk', 25, 'Llenar el formulario con el nombre del equipamiento y el precio unitario', '2014-06-17', '15:43:49'),
('5jbronxjvatn6qvj19bbkcyd175vgbeius0', 73, 'Para definir el calendario debe ingresar la fecha de inicio y de finalizacion, en ningun caso esta ultima fecha puede ser mayor que la primera fecha. Para consultar los feriados, presione el boton correspondiente de consultas', '2014-03-30', '16:05:02'),
('5pjyao9ldxbmk86lhj5xwtgoy4i4589ljtl', 1, 'Para buscar usuarios, poner el cursor en el campo buscar y escriba una palabra, para asignar permisos, consultar roles, acciones, coloque el mouse sobre las imÃ¡genes correspondientes del listado', '2014-11-04', '12:34:22'),
('7xvcl86t5dwfkkseyw38i52hfuxz8btnn9c', 24, 'Llenar el formulario con el materiale correspondiente y el precio unitario, valor decimal', '2014-06-17', '15:43:11'),
('83fgaukhvfv7l0xnhb81byevocxrrmr3787', 111, 'para registrar a un usuario, llenar los campos correspondientes y enviar el registro. El sistema le indicarÃ¡ si el usuario estÃ¡ disponible o no', '2014-11-04', '16:20:19'),
('8g3syz23k9bhp88q8zwqmrggxeyfdv7mt31', 2, 'Para realizar la busqueda de roles, escribir en al caja de texto search la palabra para encontrar el registro exacto de roles, presionar los enlaces, asignar permisos, ver permisos asignados.', '2014-03-22', '20:20:41'),
('8vy1oqdszilekac84l3psd6s8aod9cwittv', 52, 'Para realizar la busqueda, ir a la caja de texto search y escribir la palabra para encontrar coincidencias del registro exacto, para paginar los resultados presionar Next y para volver presionar el enlace previous, cuyos enlaces se encuentran en la parte inferior derecha del listado.\nPara imprimir el listado, presionar las imagenes PDF Y EXCEL respectivas.', '2014-03-21', '18:41:55'),
('be9z25h3mfnky0ilhdzbk9eze367uq6kk0v', 86, 'Para enviar un mensaje de correo electronico llene el formulario y los campos correspondiente el password representa a su password de correo electronico.\r\nPresione el boton examinar para adjuntar un archivo\r\nNota. Utilice su cuenta gmail de la misma forma que la cuenta de destino del mensaje.\r\n', '2014-04-04', '18:25:14'),
('dc37909uf3jsjbj9hqn8ma32vxglx1mjekt', 105, 'Esta opcion se encarga de mostrar la informaciÃ³n del proyecto y se puede realizar el correspondiente seguimiento mediante los botones como la informaciÃ³n detallada, seguimiento a las actividades, costos y financiamiento, y curvas de costos y avance', '2014-06-12', '19:10:09'),
('fb3lmhtcm5n4moibj3i23rnkgw4f9aiuqw2', 76, 'Para el registro de parametros llene el formulario correspondiente, el campo valor debera ser numerico y con dos decimales', '2014-03-29', '18:44:21'),
('fegiva2e4lzfadnqrk0vs7n3qyk8cpk7yyf', 4, 'El registro de sesiones se encarga de listar las sesiones al sistema por parte de los usuarios, para imprimir el registro presionar las imagenes PDF y EXCEL respectivos', '2014-06-14', '17:49:01'),
('gyklh9wgzd9irzd2nekdk6619l4ug8hc7u6', 78, 'Para realizar solicitudes de maquinaria o materiales seleccione el proyecto y presione cada boton correspondiente el cual lo dirigira al formulario de solicitud correspondiente', '2014-03-31', '11:48:02'),
('l9lietdjxn9mz8lldfrxml5c5bzb0p370ap', 71, 'Para imprimir reportes de solicitudes, en el primer formulario seleccione las fechas determinadas para imprimir el reporte. \nPresione los botones imprimir PDF y EXCEL para desplegarlos respectivamente.\nOtro modo es seleccionando estados como pendientes y atendidos. Realice el mismo procedimiento para imprimir', '2014-05-05', '12:07:59'),
('mv2elc15rf5fqc3n7srtrft4vw78jy095uc', 29, 'Para realizar la impresion de reportes ingresar rangos de fechas, seguidamente debera presionar los botones de impresion en PDF y EXCEL respectivos', '2014-04-01', '14:10:05'),
('tu1o36vaa3znxy9oklwlf6g0frj056k1xu6', 112, 'para imprimir informes de estado de usuarios, seleccione el estado de la lista desplegable y presione imprimir, el sistema generara un archivo pdf', '2014-11-05', '16:34:22'),
('v3734rsd2dk1dtiq51ai789zx36nmte2c8l', 68, 'Para realizar el registro de solicitud de mano de obra, llenar el formulario correspondiente, todos los campos son requeridos, desplegar los dropdowns correspodientes para cambiar de registro.\nEl campo cantidad debe ser llenado con un valolr numerico.', '2014-03-22', '22:10:36'),
('xmijlbvcpg3s3sezrfa7ph7rcchqkmgsalq', 83, 'Para solicitar cotizacion de items, seleccioanr el proveedor, a continuacion presione el boton solicitar cotizacion', '2014-06-16', '09:56:14');
INSERT INTO `ayuda_subpermiso` (`IDmensaje`, `IDpagina`, `descripcion`, `fecCreacion`, `hraCreacion`) VALUES
('mng30b72ss8i9ef6ow3aah5dsh01tysohw9', 8, 'Para registrar un nuevo rol escriba el prefijo, sc_ seguido del nombre del rol sin espacios, agregue el nombre y la descripcion del rol en los campos respectivos, ambos campos son requeridos, si no llena todos los campos se muestran mensajes de alerta.', '2014-03-22', '20:39:01');
