CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_archivado`(IN `fecha1` DATE, IN `fecha2` DATE)
begin
select *from auditoria where fecha_ingreso between fecha1 and fecha2;
end$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_controlpermiso`()
begin
SELECT c.IDcontrol, e.IDempleado, u.nombre, app, apm, cg.nombre, d.nombre, fechaPermiso, motivo, observaciones, desde, hasta,c.estado
FROM usuario AS u, empleado AS e, cargo AS cg, departamento AS d, controlpermiso AS c
WHERE u.USR_UID = e.USR_UID
AND e.IDcargo = cg.IDcargo
AND e.IDdepto = d.IDdepto
AND e.IDempleado = c.IDempleado;
end$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_empleado`()
begin
SELECT empleado.nombres, app, apm, fecIngreso, cargo.nombre AS cargo, departamento.nombre AS departamento, profesion.nombre AS profesion, haberBasico, aniosTrabajo
FROM empleado, cargo, departamento, profesion
WHERE empleado.IDcargo = cargo.IDcargo
AND empleado.IDdepto = departamento.IDdepto
AND empleado.IDprofesion = profesion.IDprofesion;
end$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_Grsesion`()
begin
SELECT sum( num ) AS total, username
FROM contadoraccesos
WHERE YEAR( fecha ) = anio
AND MONTH( fecha ) = mes
GROUP BY username;
end$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_login`(in user varchar(80),pass varchar(80))
begin
select *from usuario where username=user and password=pass;
end$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_menu`(IN `user` VARCHAR(80))
begin
SELECT DISTINCT menu.IDmenu,nombreMenu
                        FROM menu, submenu, opcion, permiso, usuario
WHERE menu.IDmenu = submenu.IDmenu
AND submenu.IDsubmenu = opcion.IDsubmenu
AND opcion.IDopcion = permiso.IDopcion
AND permiso.USR_UID = usuario.USR_UID
AND usuario.username =user
order by nombreMenu asc;

end$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_permisopagina`(IN `user` VARCHAR(80), IN `opcion` INT)
begin

SELECT pagina_opcion.nombre, pagina_opcion.url
                     FROM opcion, pagina_opcion, permiso_pagina, usuario
                     WHERE opcion.IDopcion = pagina_opcion.IDopcion
                      AND pagina_opcion.IDpagina = permiso_pagina.IDpagina
                      AND permiso_pagina.USR_UID = usuario.USR_UID
                      AND username=user
                      AND opcion.IDopcion=opcion
                      and permiso_pagina.estado='activo'
					  order by pagina_opcion.nombre ASC;
end$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_sesion`(in user varchar(80))
begin

select *from usuario where username=user;

end$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_users`(in user varchar(80))
begin

select *from usuario where username !=user;

